import React from 'react';

const Admintruepage = () => {
    return (
        <div>
            <div className="container">
                <h3>Bienvenue dans la page Admin !</h3>
                <h5>Ici vous pouvez ajouter, supprimer où bien même modifier un article à votre guise !</h5>

                <img src="./admintruefront.gif"></img>
            </div>
        </div>
    );
};

export default Admintruepage;
